import React from "react";
import '../styles/Header.css';

function Header(){

    return(

        <header>
            <h2>HOME</h2>
            <p>Escolha uma categoria para visualizar</p>
            <select>
                <option>Todos</option>
                <option>Categoria</option>
                <option>Animais</option>
            </select>
        </header>
    )
}

export default Header;
